DROP DATABASE IF EXISTS projetglo2005;

CREATE DATABASE projetglo2005;
use projetglo2005;


DROP TABLE IF EXISTS Favoris;
DROP TABLE IF EXISTS Note;
DROP TABLE IF EXISTS Reponse;
DROP TABLE IF EXISTS Commentaire;
DROP TABLE IF EXISTS Cree;
DROP TABLE IF EXISTS Gifs;
DROP TABLE IF EXISTS utilisateurs;
DROP TABLE IF EXISTS Createurs;

SET GLOBAL log_bin_trust_function_creators=1;

CREATE TABLE Utilisateurs(Uid integer NOT NULL AUTO_INCREMENT, Avatar varchar(200) default "https://i.stack.imgur.com/YaL3s.jpg", Hash varchar(100), Email varchar(100), Age integer, Username varchar(50), nom varchar(100), PRIMARY KEY(Uid), UNIQUE(Username), UNIQUE(Email));
CREATE TABLE Gifs(Gid integer not null AUTO_INCREMENT, Nom varchar(100), type varchar(100), Date date, Path varchar(200), NbLike integer DEFAULT 0, NbDislike integer DEFAULT 0, NbClicK integer DEFAULT 0, PRIMARY KEY(Gid), UNIQUE(Nom, Path));
CREATE TABLE Cree(Uid integer, Gid integer, PRIMARY KEY(Gid), FOREIGN KEY(Gid) REFERENCES Gifs(Gid) ON DELETE CASCADE, FOREIGN KEY(Uid) REFERENCES Utilisateurs(uid));
CREATE TABLE Commentaire(Comid integer NOT NULL AUTO_INCREMENT, texte varchar(500), Uid integer, Gid integer, PRIMARY KEY(Comid) , FOREIGN KEY(Uid) REFERENCES Utilisateurs(Uid), FOREIGN KEY(Gid) REFERENCES Gifs(Gid) on delete cascade);
CREATE TABLE Reponse(Repid integer NOT NULL AUTO_INCREMENT, Comid integer, texte varchar(500), Uid integer, PRIMARY KEY(Repid), FOREIGN KEY(Comid) REFERENCES Commentaire(Comid) ON DELETE CASCADE, FOREIGN KEY(Uid) REFERENCES Utilisateurs(Uid));
CREATE TABLE Note(Noteid integer NOT NULL AUTO_INCREMENT, Dislike boolean, Uid integer, Gid integer, PRIMARY KEY(Noteid), UNIQUE(Uid, Gid), FOREIGN KEY(Uid) REFERENCES Utilisateurs(Uid), FOREIGN KEY(Gid) REFERENCES Gifs(Gid) ON DELETE CASCADE);
CREATE TABLE Favoris(Favid integer NOT NULL AUTO_INCREMENT, Uid integer, Gid integer, PRIMARY KEY(Favid), UNIQUE(Uid, Gid), FOREIGN KEY(Uid) REFERENCES Utilisateurs(Uid), FOREIGN KEY(Gid) REFERENCES Gifs(Gid) ON DELETE CASCADE);



DELIMITER //

CREATE TRIGGER AgeUtilisateur
    BEFORE INSERT ON Utilisateurs
    FOR EACH ROW
    BEGIN
        IF NEW.Age < 58 OR NEW.Age > 76 THEN
            SIGNAL SQLSTATE '45000';
        end if ;
    end //

DELIMITER ;



DELIMITER //

CREATE TRIGGER AumenterNombreLikeDislike
    AFTER INSERT ON  Note
    FOR EACH ROW
    BEGIN
        IF NEW.Dislike = False THEN
            UPDATE Gifs G SET G.NbLike = G.NbLike + 1 WHERE G.Gid = NEW.Gid;
        ELSE
            UPDATE Gifs G SET G.NbDislike = G.NbDislike + 1 WHERE G.Gid = NEW.Gid;
        end if ;
    end //

DELIMITER ;

DELIMITER //

CREATE TRIGGER DiminuerNombreLikeDislike
    AFTER DELETE ON  Note
    FOR EACH ROW
    BEGIN
        IF OLD.Dislike = FALSE THEN
        UPDATE Gifs G SET G.NbLike = G.NbLike - 1 WHERE G.Gid = OLD.Gid;
        ELSE
            UPDATE Gifs G SET G.NbDislike = G.NbDislike - 1 WHERE G.Gid = OLD.Gid;
        END IF;
    end //

DELIMITER ;

















DELIMITER //
CREATE FUNCTION emailEtUsernameUnique(email varchar(100), username varchar(100)) RETURNS boolean
BEGIN
    DECLARE uniqu boolean;
    set uniqu := true;
    IF exists(SELECT U.email FROM utilisateurs U WHERE U.email = email) OR exists(SELECT U.username FROM utilisateurs U WHERE U.username = username) then
        set uniqu := false;
    end if ;
    RETURN uniqu;
end //
DELIMITER ;

